DROP TABLE IF EXISTS "mv_ads_kpi_30d_compare";
CREATE VIEW "mv_ads_kpi_30d_compare" AS WITH params AS (
         SELECT COALESCE(max(ads_spend.date), CURRENT_DATE) AS max_d
           FROM ads_spend
        ), ranges AS (
         SELECT params.max_d,
            ((params.max_d - '29 days'::interval))::date AS cur_start,
            params.max_d AS cur_end,
            ((params.max_d - '59 days'::interval))::date AS prev_start,
            ((params.max_d - '30 days'::interval))::date AS prev_end
