        ), base AS (
         SELECT ads_spend.date AS dt,
            ads_spend.platform,
            ads_spend.account,
            ads_spend.campaign,
            ads_spend.country,
            ads_spend.device,
            (ads_spend.spend)::numeric AS spend,
            (ads_spend.conversions)::numeric AS conversions
           FROM ads_spend
        )
 SELECT b.platform,
    b.account,
    b.campaign,
    b.country,
    b.device,
    sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.spend
            ELSE (0)::numeric
        END) AS spend_last_30d,
    sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.conversions
            ELSE (0)::numeric
        END) AS conversions_last_30d,
    sum(
        CASE
            WHEN ((b.dt >= r.prev_start) AND (b.dt <= r.prev_end)) THEN b.spend
            ELSE (0)::numeric
        END) AS spend_prev_30d,
    sum(
        CASE
            WHEN ((b.dt >= r.prev_start) AND (b.dt <= r.prev_end)) THEN b.conversions
            ELSE (0)::numeric
        END) AS conversions_prev_30d,
    round((sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.spend
            ELSE NULL::numeric
        END) / NULLIF(sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.conversions
            ELSE NULL::numeric
        END), (0)::numeric)), 4) AS cac_last_30d,
    round(((sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.conversions
            ELSE NULL::numeric
        END) * (100)::numeric) / NULLIF(sum(
        CASE
            WHEN ((b.dt >= r.cur_start) AND (b.dt <= r.cur_end)) THEN b.spend
            ELSE NULL::numeric
        END), (0)::numeric)), 4) AS roas_last_30d,
    round((sum(
        CASE
            WHEN ((b.dt >= r.prev_start) AND (b.dt <= r.prev_end)) THEN b.spend
            ELSE NULL::numeric
        END) / NULLIF(sum(
        CASE
            WHEN ((b.dt >= r.prev_start) AND (b.dt <= r.prev_end)) THEN b.conversions
