    round((((cur.conv_cur - prev.conv_prev) / NULLIF(prev.conv_prev, (0)::numeric)) * (100)::numeric), 2) AS conversions_delta_pct,
    round((cur.spend_cur / NULLIF(cur.conv_cur, (0)::numeric)), 4) AS cac_last_30d,
    round((prev.spend_prev / NULLIF(prev.conv_prev, (0)::numeric)), 4) AS cac_prev_30d,
    round(((((cur.spend_cur / NULLIF(cur.conv_cur, (0)::numeric)) - (prev.spend_prev / NULLIF(prev.conv_prev, (0)::numeric))) / NULLIF((prev.spend_prev / NULLIF(prev.conv_prev, (0)::numeric)), (0)::numeric)) * (100)::numeric), 2) AS cac_delta_pct,
    round(((cur.conv_cur * (100)::numeric) / NULLIF(cur.spend_cur, (0)::numeric)), 4) AS roas_last_30d,
    round(((prev.conv_prev * (100)::numeric) / NULLIF(prev.spend_prev, (0)::numeric)), 4) AS roas_prev_30d,
    round((((((cur.conv_cur * (100)::numeric) / NULLIF(cur.spend_cur, (0)::numeric)) - ((prev.conv_prev * (100)::numeric) / NULLIF(prev.spend_prev, (0)::numeric))) / NULLIF(((prev.conv_prev * (100)::numeric) / NULLIF(prev.spend_prev, (0)::numeric)), (0)::numeric)) * (100)::numeric), 2) AS roas_delta_pct
   FROM ((((((cur
     FULL JOIN prev USING (platform_key, account_key, campaign_key, country_key, device_key))
     JOIN dim_platform p(platform_key_1, platform) ON ((p.platform_key_1 = COALESCE(cur.platform_key, prev.platform_key))))
     JOIN dim_account a(account_key_1, account) ON ((a.account_key_1 = COALESCE(cur.account_key, prev.account_key))))
     JOIN dim_campaign c(campaign_key_1, campaign) ON ((c.campaign_key_1 = COALESCE(cur.campaign_key, prev.campaign_key))))
     JOIN dim_country co(country_key_1, country) ON ((co.country_key_1 = COALESCE(cur.country_key, prev.country_key))))
     JOIN dim_device dv(device_key_1, device) ON ((dv.device_key_1 = COALESCE(cur.device_key, prev.device_key))));

DROP TABLE IF EXISTS "v_fact_ads_kpis";
CREATE VIEW "v_fact_ads_kpis" AS SELECT d.date_value AS date,
    p.platform,
    a.account,
    c.campaign,
    co.country,
    dv.device,
    f.impressions,
    f.clicks,
    f.spend,
    f.conversions,
    round(((f.clicks)::numeric / (NULLIF(f.impressions, 0))::numeric), 6) AS ctr,
    round((f.spend / (NULLIF(f.clicks, 0))::numeric), 4) AS cpc,
    round(((f.spend / (NULLIF(f.impressions, 0))::numeric) * (1000)::numeric), 4) AS cpm,
    round((f.spend / NULLIF(f.conversions, (0)::numeric)), 4) AS cpa,
    round((f.conversions / (NULLIF(f.clicks, 0))::numeric), 6) AS cvr,
    round(((f.conversions * (100)::numeric) / NULLIF(f.spend, (0)::numeric)), 4) AS roas
   FROM ((((((fact_ads_metrics f
     JOIN dim_date d ON ((d.date_key = f.date_key)))
     JOIN dim_platform p ON ((p.platform_key = f.platform_key)))
     JOIN dim_account a ON ((a.account_key = f.account_key)))
     JOIN dim_campaign c ON ((c.campaign_key = f.campaign_key)))
     JOIN dim_country co ON ((co.country_key = f.country_key)))
     JOIN dim_device dv ON ((dv.device_key = f.device_key)));

